    false,nt"url": null,nt"notes": "The Addressn               Ranges Relationship
    File (ADDR.dbf) contains the attributes of each address range.n               Each
    address range applies to a single edge and has a unique address range identifiern
                  (ARID) value. The edge to which an address range applies can be determined
    by linkingn               the address range to the All Lines Shapefile (EDGES.shp)
    using the permanentn               topological edge identifier (TLID) attribute.
    Multiple address ranges can apply ton               the same edge since an edge
    can have multiple address ranges. Note that the mostn               inclusive address
    range associated with each side of a street edge already appears inn               the
    All Lines Shapefile (EDGES.shp). The TIGER/Line Files contain potential addressn
                  ranges, not individual addresses. The term "address range" refers
    to the collectionn               of all possible structure numbers from the first
    structure number to the lastn               structure number and all numbers of
    a specified parity in between along an edge siden               relative to the
    direction in which the edge is coded. The address ranges in then               TIGER/Line
    Files are potential ranges that include the full range of possiblen               structure
    numbers even though the actual structures may not exist.n            ",nt"license_title":
